import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

import Rating from '@mui/material/Rating';
import IconButton from '@mui/material/IconButton';
import { GoogleIcon } from '../parts/googleIcon';
import { HotPepperIcon } from '../parts/hotPepperIcon';
import { margin, maxWidth } from '@mui/system';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';

import TestImage from '../../images/neko.jpeg'

export default function ResultCard(props) {
    return (
        <Card sx={{
            mb: 2,
            height: props.mode == 'noresults' ? 200 : 300
        }}>

            {props.mode != 'noresults' &&
                <CardMedia
                    component="img"
                    height="150"
                    image={TestImage}
                    alt="picture"
                />}



            <CardContent>

                <Grid container spacing={1}>
                    <Grid item xs={12} md={12}>

                        <Typography gutterBottom variant="h5" component="div"
                            sx={{ textAlign: 'center' }}>
                            {props.name}
                        </Typography>

                    </Grid>

                    <Grid item xs={12} md={12}>
                        <Typography variant="body2"
                            sx={{
                                fontSize: props.mode == 'noresults' ? '5rem' : '1rem',
                                textAlign: 'center'
                            }}
                            color="text.secondary">
                            {props.vicinity}
                        </Typography>
                    </Grid>

                    <Grid item xs={12} md={12}>
                    {props.mode != 'noresults' && <Rating name="read-only" value={props.rating} precision={0.5} />}
                    {props.mode != 'noresults' && <Typography>{`(${props.rat})`}</Typography>}
                    </Grid>
                </Grid>

            </CardContent>

            {props.mode != 'noresults' && 

            <CardActions>

                <Button size="small">Share</Button>
                <Button size="small">Learn More</Button>

                {props.google && <IconButton onClick={() => window.open(`http://www.${props.google}`, "_blank")}>
                    <GoogleIcon />
                </IconButton>}
                {props.hotpepper && <IconButton onClick={() => window.open(`http://www.${props.hotpepper}`, "_blank")}>
                    <HotPepperIcon />
                </IconButton>}

            </CardActions>}
        </Card>
    );
}
